+ (NSArray *)getWordsWithType:(WordsType)type{
    NSArray *strings = @[];
    switch (type) {
        case ReadingWordsType:
            strings = self.readingWords;
            break;
        case ReadingMethodsType:
            strings = self.readingMethods;
            break;
        default:
            break;
    }
    return strings;
}

